import React, { useState } from 'react';
/** @jsx jsx */
/** @jsxFrag React.Fragment */
import { jsx, css } from '@emotion/core';
import Link from 'next/link';

export default function () {
  const iframe = css`
    border: 0;
    width: 30%;
    height: 30%;
  `;

  const logo = css`
    font-size: 30px;
    color: #ffff;
    margin-left: 20px;
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: space-between;
    background: #f26968;
    font-family: 'Julius Sans One', sans-serif;
    padding: 20px;
  `;

  const app = css`
    background: #f26968;
    min-height: 100vh;
    font-weight: 400;
    font-family: 'sans-serif';
    width: 100%;
    position: absolute;
  `;

  const mainTitle = css`
    color: #ffff;
    font-family: 'Julius Sans One', sans-serif;
    text-align: center;
    letter-spacing: 0.1em;
  `;

  const datePicker = css`
    display: flex;
    flex-direction: row;
    justify-content: center;
  `;

  const dates = css`
    padding: 5%;
    margin-left: 30px;
  `;

  return (
    <>
      <style>
        @import
        url('https://fonts.googleapis.com/css2?family=Muli&display=swap');
      </style>
      <div css={app}>
        <Link href={'/index'}>
          <a href="#a" css={logo}>
            Wolfi
          </a>
        </Link>
        <h1 css={mainTitle}>YOUR TRIP PLAN</h1>

        <h2 css={mainTitle}>Get your plan here </h2>
        <input>What are your interests?:</input>
        <div css={datePicker}>
          <label for="start">Start date:</label>
          <input
            type="date"
            id="start"
            name="trip-start"
            value="2020-06-23"
            min="2020-06-23"
            max="2020-08-30"
          />
        </div>
        <Link href={'/readyToGo'}>
          <a href="#a">Get your plan! &#x0226B;</a>
        </Link>
      </div>
    </>
  );
}
